import React from 'react';
import './App.css';
import Header from './pages/Header';
import Table from './pages/Table';
import Footer from './pages/Footer';
import Navbar from './pages/Navbar';

function App() {
  return (
    <div className="App">
       <Header/>
      <div>
        <h4>Table</h4>
        <Table/>
        <h3>Buttons</h3>
        <Form/>
      </div>
      <Footer/>
      <Navbar/>
    </div>


  );
}

export default App;
